import React from "react";
import Navbar from "./Navbar";
import classes from "./Service.module.css";
// importing Link from react-router-dom to navigate to
// different end points.

const Service = () => {
  return (
    <div>
      <Navbar />
      <div className={classes.top}>
        <img src="./assets/bluebg.png" />
        <div className={classes.content}>
          <h2>Cloud Transformation</h2>
          <p>
            Unlock great business value and opportunities without giving up
            control of your data.
          </p>
        </div>
        <div className={classes.conte}>
          <h2>Cloud Transformation</h2>
          <p>
            Unlock great business value and opportunities without giving up
            control of your data.
          </p>
        </div>
      </div>
      <p className={classes.para}>
        Oaknst provides you with highly secure and scalable cloud solutions that
        guarantee the highest level of data security. We have solutions for your
        needs â€“ whether you are at an early age of deploying your migration
        strategy or want to transform your existing cloud to make it comparable
        with the best.{" "}
      </p>
    </div>
  );
};

export default Service;
